## Results
### Compute LMM Model with Random Intercepts
This code fits a radom-intercept LMM to predict 'Height' across 3 annual visits, accounting for individual-level variability (random effects) of intercept values across participants. Model output is provided below, as well as a brief summary of results.

This model accounts for individual variability in height by including a random intercept for each subject (id). The output indicates that the model was fit using the REML (Restricted Maximum Likelihood) criterion. 


::: {.cell layout-align="center"}

```{.r .cell-code}
model <- lmer(height ~ 1 + event + (1 | id), data = df_long, REML = T)

## Output and summary statistics
summary(model)
```

