### Model Plots
The following set of plots xxxxx.


::: {.cell layout-align="center"}

```{.r .cell-code}
# Extract fixed effects
fixed_effects <- fixef(model)

# Prepare data frame for plotting
df_long$predicted_height <- predict(model, re.form = NA) # Overall fixed effect predictions

# Calculate individual intercept adjustments
df_long$individual_intercept <- predict(model, re.form = ~ (1 | id)) - fixed_effects[1]

# Generate the plot
ggplot(df_long, aes(x = event, y = height)) +
    geom_line(aes(y = height, color = "Individual Trajectories"), alpha = 0.3) +
    geom_line(aes(y = predicted_height + individual_intercept, group = id, color = "Adjusted Individual Trajectories"), alpha = 0.7) +
    geom_line(aes(x = event, y = predicted_height, group = 1, color = "Sample Mean Trajectory"), size = 1.5) +
    scale_color_manual(values = c("Individual Trajectories" = "red", "Adjusted Individual Trajectories" = "grey", "Sample Mean Trajectory" = "blue")) +
    labs(
        title = "Individual Trajectories with Fixed Slope and Random Intercepts",
        x = "Event Name",
        y = "Height (inches)",
        color = "Trajectory Type"
    ) +
    theme_minimal() +
    theme(legend.position = "bottom")
```

