This plot illustrates the change in participant's height across 3 annual measurement occassions. The individual raw data points are shown as red lines, representing the original height measurements, which demonstrate the variability among participants at each time point. These are overlaid with grey lines, which adjust each individual's trajectory to start from their unique intercept while following a common growth pattern indicated by the fixed effects from the model. The blue line represents the sample mean trajectory, calculated from the model's fixed effects, showcasing the average growth trend across all participants. 

The plot shows individual trajectories that vary around the model's predicted values due to random effects, indicating substantial inter-individual variability in baseline heights. On average, participants experienced an increase in height of approximately 2.36 inches from baseline to Year 1 and an additional 2.66 inches from Year 1 to Year 2. The random effects for individual intercepts suggest differences in starting heights, with a standard deviation of 3.03 inches, reflecting the variability in growth patterns among the participants.

## Wrapping Up
The random-intercept LMM analysis revealed an increasing pattern of change in children's height measured over 3 annual assessments. The mean intercept value showed an average initial height of 55.24 inches (sd = 3.03) with evidence of individual variability around this (random effect) estimate. An examination of the slope factor revealed year-to-year growth increments of approxmiately 2.5 inches, with the rate of change held constant across all participants. 

The LMM framework used in this example offered the ability to account for individual differences in initial height and the consistent growth patterns over time, demonstrating its utility in handling clustered or correlated data that arise from repeated measurements on the same subjects. More generally, this approach is often particularly useful in developmental studies as it allows for the inclusion of both fixed effects, which estimate common parameters across all individuals, and random effects, which capture unique variations among individuals. This enables a more precise understanding of both the group-level trends and individual-specific trajectories in longitudinal data.
